import { Link } from "react-router-dom";

const ProjectCard = ({ info, img }) => {
    proj_name = info.name
    id = info.id
    date = info.date
    description = info.description

    return (
        <div className="project" id={id}>
            <Link className="project-link">
                <img src={require(img)} />
                <h2>
                    {proj_name}
                </h2>
                <h3>
                    {date}
                </h3>
                <p>
                    {description}
                </p>
            </Link>
        </div>
    )
}

export default ProjectCard;
